import React, { useEffect, useState } from "react";
import Navbar from "./navbar";
import Footer from "./footer";
import '../styles/Program.css';

function Programm() {
    const [programs, setPrograms] = useState([]);

    // Fetch data from Django backend
    useEffect(() => {
        const fetchPrograms = async () => {
            try {
                const response= await fetch("http://localhost:8000/program/programs/");

                const data = await response.json();
                setPrograms(data);
            } catch (error) {
                console.error('Error fetching programs:', error);
            }
        };

        fetchPrograms();
    }, []);

    return (
        <>
            <Navbar />

            <div className="program-container">
                <h1>Our Fitness Programs</h1>
                <div className="program-list">
                    {programs.map((program) => (
                        <div key={program.id} className="program-card">
                            <img
                                src={`/media/${program.programm_img}`}
                                alt={program.programm_name}
                                className="program-image"
                            />
                            <div className="program-info">
                                <h2>{program.programm_name}</h2>
                                <p>{program.description}</p>
                                <p><strong>Key Features:</strong> {program.key_features}</p>
                                <p><strong>Work Includes:</strong> {program.work_include}</p>
                                <p><strong>Examples:</strong> {program.example}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>

            <Footer />
        </>
    );
}

export default Programm;
